import React from "react";

import Header from "../../components/Header";
import Carousel from "../../components/Carousel";

import "./index.css";
import { Link } from "react-router-dom";

const Homepage = () => {
  return (
    <>
      <Header>
        <Carousel></Carousel>
      </Header>
      <main id="about" className="ui container">
        <div className="ui stackable two column grid">
          <div className="column">
            <img
              src="/images/profile2.jpeg"
              className="ui medium middle aligned circular image"
            ></img>
          </div>
          <div className="column">
            <h1 className="ui header">Sobre Mim</h1>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Explicabo
              tempora numquam veritatis aliquam rerum ullam nihil, dolore eius
              totam, pariatur quaerat saepe dolores nemo cum.
            </p>
            <button className="ui button">
              <Link to="sobre">Leia Mais</Link>
            </button>
          </div>
        </div>
      </main>
    </>
  );
};

export default Homepage;
